import { Container } from "react-bootstrap";
import "./Home.css";
function Home() {
  return (
    <Container>
      <section style={{ backgroundColor: "#f7ede3" }} className="p-3 mt-3 home">
        <img src='../home.jpg' className='img-fluid shadow-4 image m-auto' alt='...' />
        <article>
            <div className="title">
                <h1>OUR PARTNER</h1>
            </div>
        </article>
      </section>
    </Container>
  );
}

export default Home;
